import { Link } from 'react-router-dom';
// import './Listing.css';

function Listing ({ list }) {
    console.log(list)
    return (
        <div className='listing-main'>
            <Link className='listing-info' to={`/listings/${list.id}`}>
                <img className='listing-image' alt='' src={list.photo}/>
            </Link>
            <div className='listing-description'>
                <p className='listing-name' >{list.name}</p>
                <p className='listing-description'>{list.description}</p>
                <p className='listing-address'>{list.address}</p>
                <p className='listing-price'>{list.price}</p>
                <p className='listing-guests'>{list.guests}</p>
                <p className='listing-bedrooms'>{list.bedrooms}</p>
                <p className='listing-baths'>{list.baths}</p>
                <p className='listing-address'>{list.address}</p>
                <p className='listing-coordinates'>{list.latitude}</p>
            </div>

        </div>
      )
}

export default Listing;
